(function(){tinymce.create("tinymce.plugins.filemanager",{init:function(e,t){e.addCommand("mceExample",function(){e.windowManager.open({file:"service.php?mod=file&com=list",width:320,height:120,inline:1},{plugin_url:t,some_custom_arg:"custom arg"})});e.addButton("filemanager",{title:"file manager",cmd:"mcefileManager",image:t+"/img/example.gif"})},createControl:function(e,t){return null},getInfo:function(){return{longname:"Example plugin",author:"Some author",authorurl:"http://tinymce.moxiecode.com",infourl:"http://wiki.moxiecode.com/index.php/TinyMCE:Plugins/example",version:"1.0"}}});tinymce.PluginManager.add("filemanager",tinymce.plugins.filemanager)})()